style.css:
/* Cream Aesthetic Style */

body {
  background-color: #f5f5dc; /* Cream color background */
  color: #333; /* Soft dark text */
  font-family: 'Georgia', serif; /* Elegant serif font for a classic feel */
  line-height: 1.6;
  margin: 0;
  padding: 0;
}

/* Header Style */
header {
  background-color: #fffaf0; /* Light cream color */
  color: #333;
  text-align: center;
  padding: 2rem 0;
  box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.1);
}

header h1 {
  font-size: 2.5rem;
  margin: 0;
}

/* Navigation Menu */
nav {
  margin-top: 1rem;
}

nav a {
  color: #8b7765; /* Light coffee color */
  text-decoration: none;
  margin: 0 1rem;
  font-size: 1.2rem;
}

nav a:hover {
  color: #333; /* Darker hover effect */
}

/* Main Content */
main {
  max-width: 1200px;
  margin: 2rem auto;
  padding: 1rem;
  background-color: #fdf5e6; /* Very light cream color */
  border-radius: 8px;
  box-shadow: 0px 4px 12px rgba(0, 0, 0, 0.05);
}

/* Typography */
h2 {
  color: #8b7765;
}

p {
  font-size: 1.1rem;
  color: #555;
  margin-bottom: 1.5rem;
}

/* Button Style */
button {
  background-color: #e0c097; /* Soft beige button */
  color: #333;
  padding: 0.75rem 1.5rem;
  border: none;
  border-radius: 4px;
  font-size: 1rem;
  cursor: pointer;
  transition: background-color 0.3s ease;
}

button:hover {
  background-color: #c8a165; /* Darker beige on hover */
}

/* Footer */
footer {
  background-color: #fffaf0;
  text-align: center;
  padding: 1rem;
  color: #333;
}

footer p {
  margin: 0;
}
